import React, { useState, useEffect } from "react";
import { useAuth } from "../../context/AuthContext";
import { studentsAPI, coursesAPI } from "../../services/api";
import {
  BookOpen,
  GraduationCap,
  CheckCircle,
  Clock,
  Star,
  TrendingUp,
  FileText,
  ExternalLink,
} from "lucide-react";

const StudentEnrolledCoursesPage = () => {
  const { user } = useAuth();
  const [enrolledCourses, setEnrolledCourses] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    if (user?.role === "student") {
      fetchStudentProfile();
    }
  }, [user]);

  const fetchStudentProfile = async () => {
    try {
      setLoading(true);
      console.log("üéì Fetching student profile for enrolled courses...");

      const profileResponse = await studentsAPI.getProfile();
      const studentData = profileResponse.data || profileResponse;

      console.log("üìä Full student data:", studentData);
      console.log("ÔøΩ Active courses:", studentData?.active_courses);

      // The backend returns active_courses array with enrolled course details
      if (studentData?.active_courses && Array.isArray(studentData.active_courses)) {
        console.log("‚úÖ Found active_courses array:", studentData.active_courses.length, "courses");
        setEnrolledCourses(studentData.active_courses);
      } else {
        console.log("‚ùå No active_courses found in student data");
        setEnrolledCourses([]);
      }
    } catch (error) {
      console.error("‚ùå Error fetching student profile:", error);
      setEnrolledCourses([]);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="flex justify-center items-center min-h-screen">
        <div className="animate-spin rounded-full h-32 w-32 border-b-2 border-blue-600"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header Section */}
      <div className="bg-gradient-to-r from-blue-600 to-indigo-700 rounded-lg shadow-lg p-6 text-white">
        <div className="flex items-center justify-between">
          <div>
            <h1 className="text-3xl font-bold flex items-center">
              <GraduationCap className="h-8 w-8 mr-3" />
              My Enrolled Courses
            </h1>
            <p className="text-blue-100 mt-2">
              {enrolledCourses.length > 0
                ? `You are enrolled in ${enrolledCourses.length} course${
                    enrolledCourses.length !== 1 ? "s" : ""
                  }`
                : "You haven't enrolled in any courses yet"}
            </p>
          </div>
          <div className="text-right">
            <p className="text-sm text-blue-200">Welcome back,</p>
            <p className="text-xl font-semibold">
              {user?.first_name || "Student"}
            </p>
          </div>
        </div>
      </div>

      {/* Enrolled Courses Section */}
      <div className="bg-white rounded-lg shadow-md">
        {enrolledCourses.length === 0 ? (
          <div className="text-center py-12 px-6">
            <BookOpen className="mx-auto h-16 w-16 text-gray-400 mb-4" />
            <h3 className="text-lg font-medium text-gray-900 mb-2">
              No Enrolled Courses
            </h3>
            <p className="text-gray-500 mb-6">
              You haven't enrolled in any courses yet. Explore available courses
              to get started.
            </p>
            <button
              onClick={() => (window.location.href = "/courses")}
              className="inline-flex items-center px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors"
            >
              <ExternalLink className="h-4 w-4 mr-2" />
              Browse Courses
            </button>
          </div>
        ) : (
          <div className="divide-y divide-gray-200">
            {enrolledCourses.map((course, index) => {
              console.log("üîç Displaying course:", course);

              // Extract course information directly from course object
              const courseName =
                course.course_name || course.name || "Unknown Course";
              const courseCode = course.course_code || course.code || "N/A";
              const courseDuration =
                course.course_duration || course.duration || "N/A";
              const courseCredits = course.credits || "N/A";
              const courseFee = course.course_fee || course.fee || "N/A";

              return (
                <div
                  key={course.id || index}
                  className="p-6 hover:bg-gray-50 transition-colors"
                >
                  {/* Course Header */}
                  <div className="flex items-start justify-between mb-4">
                    <div className="flex-1">
                      <div className="flex items-center mb-2">
                        <h3 className="text-xl font-bold text-gray-900">
                          {courseName}
                        </h3>
                        <span className="ml-3 inline-flex items-center px-3 py-1 rounded-full text-sm font-medium bg-green-100 text-green-800">
                          <CheckCircle className="h-4 w-4 mr-1" />
                          Enrolled
                        </span>
                      </div>
                      <p className="text-sm text-gray-600 mb-2">
                        <span className="font-semibold">Course Code:</span>{" "}
                        <span className="font-mono text-blue-600">
                          {courseCode}
                        </span>
                      </p>
                    </div>
                  </div>

                  {/* Course Details Grid */}
                  <div className="grid grid-cols-1 md:grid-cols-3 gap-4 mb-4">
                    <div className="flex items-center space-x-3">
                      <div className="p-2 rounded-lg bg-yellow-100">
                        <Star className="h-5 w-5 text-yellow-600" />
                      </div>
                      <div>
                        <p className="text-sm text-gray-500">Credits</p>
                        <p className="font-semibold text-gray-900">
                          {courseCredits}
                        </p>
                      </div>
                    </div>

                    <div className="flex items-center space-x-3">
                      <div className="p-2 rounded-lg bg-blue-100">
                        <Clock className="h-5 w-5 text-blue-600" />
                      </div>
                      <div>
                        <p className="text-sm text-gray-500">Duration</p>
                        <p className="font-semibold text-gray-900">
                          {courseDuration !== "N/A"
                            ? `${courseDuration} months`
                            : "1 semester"}
                        </p>
                      </div>
                    </div>

                    <div className="flex items-center space-x-3">
                      <div className="p-2 rounded-lg bg-purple-100">
                        <TrendingUp className="h-5 w-5 text-purple-600" />
                      </div>
                      <div>
                        <p className="text-sm text-gray-500">Course Fee</p>
                        <p className="font-semibold text-gray-900">
                          {courseFee !== "N/A"
                            ? `$${courseFee}`
                            : "Contact for pricing"}
                        </p>
                      </div>
                    </div>
                  </div>

                  {/* Course Description */}
                  <div className="mb-4">
                    <h4 className="text-sm font-semibold text-gray-700 mb-2 flex items-center">
                      <FileText className="h-4 w-4 mr-2" />
                      Course Description
                    </h4>
                    <div className="bg-gray-50 p-4 rounded-lg">
                      <p className="text-sm text-gray-600">
                        {course.description || "No description available"}
                      </p>
                    </div>
                  </div>
                </div>
              );
            })}
          </div>
        )}
      </div>

      {/* Quick Actions */}
      {enrolledCourses.length > 0 && (
        <div className="text-center">
          <button
            onClick={() => (window.location.href = "/courses")}
            className="inline-flex items-center px-6 py-3 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors font-medium"
          >
            <ExternalLink className="h-5 w-5 mr-2" />
